import { Component, Injectable, HostListener, OnInit, OnDestroy  } from '@angular/core';
import { Router } from '@angular/router';
import { FamilyMemberService } from 'src/app/services/familyMember.service';
import { AuthService } from './services/authService.service';

@Injectable({
  providedIn: 'root'
})
@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {


  loggedInMemberId = 0;


  constructor(private router: Router,
    private authService: AuthService,
    private familyMemberService: FamilyMemberService
  ) {
    this.setViewportHeight();
    this.addEventListeners();
  }

  ngOnInit(): void {
    this.loggedInMemberId = this.familyMemberService.getLoggedInMemberId();
  }

  // Function to dynamically calculate and set the viewport height
  setViewportHeight(): void {
    const vh = window.innerHeight * 0.01;
    document.documentElement.style.setProperty('--vh', `${vh}px`);
  }

  // Function to listen for resize and load events
  addEventListeners(): void {
    window.addEventListener('resize', () => this.setViewportHeight());
    window.addEventListener('load', () => this.setViewportHeight());
  }

  logout(): void {
    this.authService.logout(); // Call the AuthService to perform logout
    this.router.navigate(['/home']); // Redirect to the login page
  }

  login(): void {
    this.router.navigate(['/login']); // Redirect to the login page
  }

  isLoggedIn() {
    if(this.authService.isAuthenticated()){
      return true;
    }
    return false;
  }

  viewMyProfile() {
    this.loggedInMemberId = this.familyMemberService.getLoggedInMemberId()
      if(this.loggedInMemberId !== 0){
        // Navigate to the view component and pass the id
      this.router.navigate(['/view', this.loggedInMemberId]);
      }
  }

  allSearch(){
    this.router.navigate(['/allsearch']);
  }

  goToHome() {
    this.router.navigate(['/home']);
  }

  goToDashboard() {
    this.router.navigate(['/dashboard']);
  }

  viewSJSInfo(){
    this.router.navigate(['/sjsinfo']);
  }

  viewSMMInfo(){
    this.router.navigate(['/smminfo']);
  }

  viewSYSInfo(){
    this.router.navigate(['/sysinfo']);
  }

  viewSBMInfo(){
    this.router.navigate(['/sbminfo']);
  }
}
<div class="page-container">
  <!-- <nav class="navbar navbar-dark primary-button-style nav-height"> -->
    <div class="">
      <div class="disply-flex">
        <section>
          <div class="example-button-row">
            <div class="example-flex-container">
              <div class="example-button-container">
                <button class="menu-button-layout" [matMenuTriggerFor]="menu" mat-mini-fab aria-label="Example icon button with a menu icon">
                  <mat-icon>menu</mat-icon>
                </button>

                <!-- Logo Image -->
                <img
                src="assets/sjs_logo.png" 
                alt="Logo"
                class="logo-image"
                />

                <p class="logo-text"><strong><span style="color: red;">Sadhumargi Jain Sangh</span><span style="color: #66548e"> Udaipur</span></strong></p>
                <mat-menu #menu="matMenu">
                  <!-- Home Menu Item -->
                  <button (click)="goToHome()" mat-menu-item>
                    <mat-icon>home</mat-icon>
                    <span>Home</span>
                  </button>
                  <button *ngIf="isLoggedIn()" (click)="goToDashboard()" mat-menu-item>
                    <mat-icon>home</mat-icon>
                    <span>Directory</span>
                  </button>

                  <!-- My Family Menu Item -->
                  <button *ngIf="isLoggedIn()" (click)="viewMyProfile()" mat-menu-item>
                    <mat-icon>supervisor_account</mat-icon>
                    <span>My Family</span>
                  </button>

                  <!-- Subheading -->
                  <!-- <h3 style="margin: 10px; font-weight: bold;">Executive Members</h3> -->

                  <!-- Submenu Trigger -->
                  <button mat-menu-item [matMenuTriggerFor]="subMenu">
                    <mat-icon>group_outline</mat-icon>
                    <span>Executive Members</span>
                  </button>

                  <!-- Submenu -->
                  <mat-menu #subMenu="matMenu">
                    <button (click)="viewSJSInfo()" mat-menu-item>
                      <mat-icon>people_outline</mat-icon>
                      <span>Sadhumargi Jain Sangh</span>
                    </button>
                    <button (click)="viewSMMInfo()" mat-menu-item>
                      <mat-icon>people_outline</mat-icon>
                      <span>Samta Mahila Mandal</span>
                    </button>
                    <button (click)="viewSYSInfo()" mat-menu-item>
                      <mat-icon>people_outline</mat-icon>
                      <span>Samta Yuva Sangh</span>
                    </button>
                    <button (click)="viewSBMInfo()" mat-menu-item>
                      <mat-icon>people_outline</mat-icon>
                      <span>Samta Bahu Mandal</span>
                    </button>
                    <button (click)="viewSBMInfo()" mat-menu-item>
                      <mat-icon>people_outline</mat-icon>
                      <span>Samta Tarun Shakti</span>
                    </button>
                    <button (click)="viewSBMInfo()" mat-menu-item>
                      <mat-icon>people_outline</mat-icon>
                      <span>Samta Yuvti Shakti</span>
                    </button>
                  </mat-menu>

                  <!-- Search Menu Item -->
                  <button *ngIf="isLoggedIn()" (click)="allSearch()" mat-menu-item>
                    <mat-icon>search</mat-icon>
                    <span>Member Search</span>
                  </button>

                  <!-- Logout Menu Item -->
                  <button *ngIf="isLoggedIn()" (click)="logout()" mat-menu-item>
                    <mat-icon>logout</mat-icon>
                    <span>Logout</span>
                  </button>

                  <!-- Login Menu Item -->
                  <button *ngIf="!isLoggedIn()" (click)="login()" mat-menu-item>
                    <mat-icon>login</mat-icon>
                    <span>Login</span>
                  </button>
                </mat-menu> 
              </div>
            </div>
          </div>
        </section>
      </div>
    </div>
  <div class="container mt-3 app-style">
    <router-outlet></router-outlet>
  </div>
</div>
